import React, { useEffect, useState } from 'react'
import './Navbar.css'
import logo from './logo.ico'
import Searchbar from './searchbar/Searchbar'
import { RiVideoAddLine } from 'react-icons/ri'
import { IoMdNotificationsOutline } from 'react-icons/io'
import { BiUserCircle } from 'react-icons/bi'
import { googleLogout, useGoogleLogin } from '@react-oauth/google'
import { gapi } from 'gapi-script'
import {
    BrowserRouter as Router,
    Routes,
    Route,
    Link,
    generatePath
} from 'react-router-dom'
import { useDispatch,useSelector } from 'react-redux'
import { login } from '../actions/auth'
import { jwtDecode } from 'jwt-decode'
import { setcurrentuser } from '../actions/currentuser'
import axios from 'axios'


function Navbar({ toggleDrawer }) {
    let currentUser = useSelector(state => state.currentuserreducer)
    // const currentUser = {
    //     result: {
    //         email: "xyz@gmail.com",
    //         joinedOn: "2222-07-15T09:57:23.489Z",
    //     },
    // }

    const [authbtn, setauthbtn] = useState(false)
    const [user,setUser] = useState([])
    const [profile,setProfile] = useState([])
    const dispatch = useDispatch()
    const successLogin = () =>
    {
        if(profile.email)
        {
            dispatch(login({ email: profile.email }))
        }
    }

    const Glogin = useGoogleLogin({
        onSuccess: (tokenResponse) => setUser(tokenResponse),
        onError: (error) => console.log("Failed",error)
    })

    // useEffect(() => {
    //     function start() {
    //         gapi.client.init({
    //             clientId: "283099722549-uom3nk4a6jfmo185sapfgk0vhlr8uf7c.apps.googleusercontent.com",
    //             scope: "email"
    //         })
    //     }
    //     gapi.load("client:auth2", start)
    // }, [])

    useEffect(() => {
        if(user)
        {
            axios.get(`https://www.googleapis.com/oauth2/v1/userinfo?access_token=${user.access_token}`,{
                headers:{
                    Authorization: `Bearer ${user.access_token}`,
                    Accept: 'application/json'
                }
            })
            .then((res)=>{
                setProfile(res.data)
                successLogin()
            })
            .catch((err)=>console.log(err))
        }
    },[user])

    const logout = () => 
    {
        dispatch(setcurrentuser(null))
        googleLogout()
        localStorage.clear()
    }

    useEffect(()=>{
        const token = currentUser?.token
        console.log(token)
        if(token)
        {
            const decodetoken = jwtDecode(token)
            if(decodetoken.exp*1000 < new Date().getTime())
            {
                logout()
            }
        }
        dispatch(setcurrentuser(JSON.parse(localStorage.getItem("Profile"))))
    },[currentUser?.token,dispatch])

    // const handleOnSuccess = (response) => {
    //     let decoded = jwtDecode(response?.credential)
    //     const Email = decoded?.email
    //     console.log(Email)
    //     dispatch(login({ email: Email }))
    // }
    // const handleOnFailure = (error) => {
    //     console.log("Failed", error)
    // }
    return (
        <div className='Container_Navbar'>
            <div className="Burger_Logo_Navbar">
                <div className="burger" onClick={() => toggleDrawer()}>
                    <p></p>
                    <p></p>
                    <p></p>
                </div>
                <Link to={'/'} className='Logo_Navbar'>
                    <img className='logo1' src={logo} alt="/" />
                    <p>YouTube</p>
                </Link>
            </div>
            <Searchbar />
            <div className="rightIcons">
                <RiVideoAddLine size={22} className='vid_bell_Navbar' />
                <IoMdNotificationsOutline size={22} className='vid_bell_Navbar' />
                <div className="apps_Box">
                    <p className="appBox"></p>
                    <p className="appBox"></p>
                    <p className="appBox"></p>
                    <p className="appBox"></p>
                    <p className="appBox"></p>
                    <p className="appBox"></p>
                    <p className="appBox"></p>
                    <p className="appBox"></p>
                    <p className="appBox"></p>
                </div>
                <div className="Auth_cont_Navbar">
                    {
                        currentUser ?
                            (<>
                                <div className="Channel_logo_App" onClick={() => setauthbtn(true)}>
                                    <p className='fstChar_logo_App'>
                                        {
                                            currentUser?.result.name ?
                                                (<>
                                                    {currentUser?.result.name.charAt(0).toUpperCase()}
                                                </>) :
                                                (<>
                                                    {currentUser?.result.email.charAt(0).toUpperCase()}
                                                </>)
                                        }
                                    </p>
                                </div>
                            </>) :
                            (<>
                                {/* <GoogleLogin 
                                    clientId={
                                        '283099722549-uom3nk4a6jfmo185sapfgk0vhlr8uf7c.apps.googleusercontent.com'
                                    }
                                    onSuccess={handleOnSuccess}
                                    onError={handleOnFailure}
                                    render={(renderProps) => (
                                        <p onClick={renderProps.onClick} className="Auth_Btn">
                                            <BiUserCircle size={22} />
                                            <b>Sign in</b>
                                        </p>
                                    )}
                                /> */}
                                <p onClick={()=>Glogin()} className="Auth_Btn">
                                    <BiUserCircle size={22} />
                                    <b>Sign in</b>
                                </p>
                            </>)
                    }
                </div>
            </div>
            {
                authbtn &&
                <Auth seteditcreatechanelbtn={seteditcreatechanelbtn} setauthbtn={setauthbtn} user={currentuser} />
            }
        </div>
    )
}

export default Navbar
